import { createRouter, createWebHashHistory } from 'vue-router';
import '@fortawesome/fontawesome-free/css/all.css';
import '@fortawesome/fontawesome-free/js/all.js';

const Login = () => import('../pages/Login/LoginComponent');
const home = () => import('../pages/Home/HomeComponent');

const routes = [
    { path: '/', name:'login', component: Login },
    { path: '/home', name:'home', component: home },
    { path: '/pessoa', name:'pessoa', component: home },
    { path: '/produto', name:'produto', component: home },
    { path: '/venda', name:'venda', component: home },
    { path: '/compra', name:'compra', component: home },
];

const router = createRouter({
  history: createWebHashHistory(),
  routes,
});

export default router;
